  \"North Slope Moose Surveys Within and Adjacent to the Arctic National Wildlife
  Refuge, Fall 1988\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:20:46.608723\",\n\t\"name\": \"north-slope-moose-surveys-within-and-adjacent-to-the-arctic-national-wildlife-refuge-fall-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Aerial moose surveys were conducted on
  the north slope from the Sagavanirktok River to the Canning River during 17-19 October
  1988. Two aircraft based from Galbraith Lake enabled the surveys to be completed
  in a timely manner and allowed for additional safety considerations. A total of
  629 moose were recorded (565 moose were counted in 1986), suggesting that the regional
  moose population is slightly increasing. The regional calf/cow and bull/cow ratios
  declined from 32 to 27 calves/100 cows and 53 to 48 bulls/100 cows during 1986 to
  1988. Trend data for the Canning River area suggests a reduced abundance of moose
  (37%) from 1985. Decline in calves/100 cows from 44 in 1985 to 16 in 1988 and reduced
  abundance of large bulls (47/100 cows in 1985 to 19/100 cows in 1988) suggest that
  low recruitment and increased harvest are likely causes for the reduction in moose
  in the Canning River area.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
